import AdminLayout from "modules/Admin/Components/AdminLayout/AdminLayout";

function DefaultLayout() {
  return <div></div>;
}

function withLayout(Component, Layout = DefaultLayout) {
  return <Layout>{Component}</Layout>;
}

export default withLayout;
